import React from "react";
import "../AppTitle/AppTitle.css";
import App from "../../App";

const AppTitle = () => {
  return (
    <div>
      <div
        className="typing"
        style={{ animationDelay: "0s", animationDuration: "2s" }}
      >
        Welcome to
      </div>
      <div
        className="typing"
        style={{ animationDelay: "2s", animationDuration: "3s" }}
      >
        TerraSomething...
      </div>
    </div>
  );
};

export default AppTitle;
